import React from "react";

const experienceData = [
    {
        company: "Selazar",
        title: "Lead Front End Developer / Head of Feature Development",
        date: "April 2019  - Present",
        tech: ["React JS", "SCSS", "Bootstrap", ".NET core", "Xamarin", "SQL Server", "Linq to SQL"]
    },
    {
        company: "Fluent Technology",
        title: "Solutions Developer",
        date: "October 2015 - April 2019",
        tech: ["React JS", "SCSS", "CSS", "Cucumber/Selenium", ".NET core", "ASP.NET", "VB.NET", "JQuery", "Kendo UI", "SQL Server", "T-SQL"]
    }
]

const Experience = () =>
    <div className="text-right mr-2">
        <h2>Experience</h2>
    </div>;

export default Experience;
